import React from 'react'
import classes from './Products./ProductsAvailable.module.css';

const DUMMY_PRODUCTS = [
    {
      id: 'm1',
      name: 'Mascara',
      description: 'Dont need anyother',
      price: 22.99,
    },
    {
      id: 'm2',
      name: 'Lipstick',
      description: 'lovely Colours!',
      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Foundations',
      description: 'pick yours right',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Highlighter',
      description: 'Shine like Star',
      price: 18.99,
    },
  ];
const ProductAvailable = () => {
    const productsList = DUMMY_PRODUCTS.map(products => <li>{products.name}</li>)
    return (
       <section className={classes.meals}>
           <ul>
               {productsList}
           </ul>
       </section>
    )
}

export default ProductAvailable
